import React from 'react';
import { useHistory } from 'react-router-dom';
import Footer from '../components/Footer';
import Header from '../components/Header';
import '../styles/Projects.css';
import { Redirect } from 'react-router';

function Projects() {
  const history = useHistory();

  // function redirect() {
  //   const url = 'https://camiladamasio.github.io/recipes-app-project/#/';
  //   window.location(url);
  // }

  return (
    <div className="main-div">
      <Header />
      <div className="projects-body">
        <div><h2>Projetos</h2></div>
        <form action="">
          <input
            type="button"
            value="Add Students"
            // onClick="window.open('https://camiladamasio.github.io/recipes-app-project/#/')"
          />
          <input
            type="button"
            value="Add Courses"
            onClick="window.location.href='Courses.html';"
          />
          <input
            type="button"
            value="Student Payments"
            onClick="window.location.href='Payment.html';"
          />
        </form>
      </div>
      <Footer />
    </div>
  );
}

export default Projects;
